import React from 'react';
const api = {
  key:"2f3b9e6411ffb9ce9ebe5d4b0896ec62",
  base:"https://api.openweathermap.org/data/2.5/"
}
function App() {
  return (
    <div className="App">
      <main>
        <div className="search-box">
          <input
            type="text"
            className="search-bar"
            placeholder="Search..."
          />
        </div>
        <div className="location-box">
          <div className="location-tag">Nagpur, Maharshtra</div>
          <div className="date">dateBuilder(new Date())</div>
        </div>
      </main>
    </div>
  );
}

export default App;
